import { eTipo } from "./eTipo";

export class Contato {
    Id : number;
    Tipo : eTipo;
    Valor: string;

    fromData(data: any){
        this.Id = data.pessoaId;
        this.Tipo = data.tipo;
        this.Valor = data.valor;
    }
}
